import React from 'react'
import "./Post.css"
const Post = ({ data, id }) => {
    console.log(data);
    return (
        <div className='post'>
            <img src={data.img} alt="" />

            <div className="PostReaction">
                <img src="" alt="" />
                <img src="" alt="" /><img src="" alt="" />
            </div>
        </div>
    )
}

export default Post
